                <div class="algorithm">Select an Algorithm :

                      <input type="radio" id="bfs-option" name="algo-selector">
                      <label for="bfs-option">Breadth First Search</label>

                        <label for="slow-option">Slow</label>
                    </li>
                    <li class="l-item" id="medium">
                        <input type="radio" id="medium-option" name="speed-selector">
                        <label for="medium-option">Medium</label>
                    </li>
                    <li class="l-item" id="fast">
                        <input type="radio" id="fast-option" name="speed-selector">
                        <label for="fast-option" >Fast</label>
                    </li>
                    <li class="l-item" id="superfast">
                        <input type="radio" id="superfast-option" name="speed-selector">

                    </li>
